function DeleteDashboardExtension(n){var t=this;this._wrapper=n;this._control=n.GetDashboardControl();this._toolbox=this._control.findExtension("toolbox");this.name="dxdde-delete-dashboard";this.deleteDashboard=function(){if(t.isExtensionAvailable()&&confirm("Delete this Dashboard?")){var n=t._control.dashboardContainer().id,i=JSON.stringify({DashboardID:n,ExtensionName:t.name});t._toolbox.menuVisible(!1);t._wrapper.PerformDataCallback(i,function(){t._control.close()})}};this._menuItem={id:this.name,title:"Delete",click:this.deleteDashboard,selected:ko.observable(!1),disabled:ko.computed(function(){return!t._control.dashboard()}),index:113,hasSeparator:!0,data:t}}DeleteDashboardExtension.prototype.isExtensionAvailable=function(){return this._toolbox!==undefined};DeleteDashboardExtension.prototype.start=function(){this.isExtensionAvailable()&&this._toolbox.menuItems.push(this._menuItem)};DeleteDashboardExtension.prototype.stop=function(){this.isExtensionAvailable()&&this._toolbox.menuItems.remove(this._menuItem)};